function UploadImage(props) {
  return (
    <input
      type="file"
      id="myFile"
      name="filename"
      accept="image/*"
      onChange={(e) =>
        handleProfileImageUpload(
          e,
          props.changeUploadFailed,
          props.changeProfileImage
        )
      }
    />
  );
}

export default UploadImage;
